import { NavMenu } from "../Header";

import { Home } from '../../pages/Home.jsx';

export function Section(props)
{
    return(
        <section {...props}>
            {props.children}
        </section>
    )
}

export function Main(props)
{
    return(
        <main role='main'>
            {props.children}
        </main>
    )
}

export function Container(props)
{
    return(
        <div className="container">
            {props.children}
        </div>
    )
}

export function Layout()
{
    return(
        <NavMenu />

    )
}
